  `alipayid` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '支付宝标志',
  `user_id` varchar(40) COLLATE utf8_bin DEFAULT NULL COMMENT '下单用户id',
  `phone` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '下单用户手机号',
