  `redpacket_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '优惠卷名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='订单表';

