-- ----------------------------
--  Table structure for `payments`
-- ----------------------------
DROP TABLE IF EXISTS `payments`;
CREATE TABLE `payments` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `service_name` varchar(128) CHARACTER SET utf8mb4 NOT NULL COMMENT '各种支付的服务名称',
  `type` varchar(128) CHARACTER SET utf8mb4 NOT NULL COMMENT 'alipay,sfp',
  `version` varchar(64) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT 'V1.0.0',
  `charset` varchar(32) CHARACTER SET utf8mb4 NOT NULL DEFAULT 'UTF-8' COMMENT '字符集UTF-8',
  `sign_type` varchar(32) CHARACTER SET utf8mb4 NOT NULL DEFAULT 'MD5' COMMENT '签名类型MD5',
  `ccy` varchar(32) CHARACTER SET utf8mb4 NOT NULL DEFAULT 'RMB' COMMENT 'RMB',
  `mch_id` varchar(32) DEFAULT NULL,
  `appid` varchar(64) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '商户ID',
  `appkey` varchar(64) NOT NULL DEFAULT '' COMMENT '商户签名',
  `appsecret` varchar(64) DEFAULT NULL,
  `account_name` varchar(128) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '账户名',
  `email` varchar(128) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '账户',
  `split_ccy` varchar(10) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '分账币种',
  `split_trans_in` varchar(64) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '分账要入账的商户号',
  `api_url` varchar(256) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '支付网关地址',
  `refund_url` varchar(256) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '退款网关地址',
  `record_no` varchar(64) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '支付平台编号',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '0 draft 1 published',
  `service_pubkey` varchar(1024) DEFAULT NULL COMMENT 'rsa验签，第三方公钥',
  `self_prikey` varchar(2048) DEFAULT NULL COMMENT 'rsa签名私钥',
  `verify_url` varchar(256) DEFAULT NULL COMMENT 'notify_id验证链接',
  `notify_url` varchar(256) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '回调地址',
  PRIMARY KEY (`id`),
  UNIQUE KEY `service_name` (`service_name`,`type`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT=' 支付渠道表';

