DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `product_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `product_price` bigint(20) NOT NULL COMMENT '商品价格',
  `product_actual_price` bigint(20) NOT NULL COMMENT '商品实际支付价格',
  `product_status` int(11) NOT NULL COMMENT '菜单状态,0下架,1上架',
  `create_time` datetime NOT NULL,
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '菜单介绍',
  `imgUrl` longtext CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '产品主图',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='菜单,也是商品';

