-- ----------------------------
--  Table structure for `redpacket`
-- ----------------------------
DROP TABLE IF EXISTS `redpacket`;
CREATE TABLE `redpacket` (
  `id` varchar(255) CHARACTER SET latin1 NOT NULL,
  `name` varchar(255) NOT NULL COMMENT '红包名称',
  `redpacket_price` bigint(20) DEFAULT NULL COMMENT '优惠金额',
  `redpacket_total` bigint(20) NOT NULL COMMENT '红包数量',
  `status` int(11) NOT NULL COMMENT '红包状态,0,禁用,1可用',
  `create_time` datetime NOT NULL,
  `remark` varchar(255) DEFAULT NULL,
  `redpacket_type` int(11) NOT NULL COMMENT '红包类型，1折扣劵，2.优惠卷，3.满减优惠（这个暂时累用）',
  `discount_ratio` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '折扣比率，满减优惠（例如，0.95或者满100减100）',
  `limit_day` int(11) NOT NULL COMMENT '红包使用时间,多少天内有效'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='优惠劵';

