CREATE TABLE `user_redpacket_relaction` (
  `id` varchar(255) CHARACTER SET latin1 NOT NULL,
  `redpacket_id` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '红包id',
  `redpacket_name` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '红包名称',
  `user_id` varchar(40) COLLATE utf8_bin NOT NULL COMMENT '领取红包用户',
  `user_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '领取用户名称',
